import "./App.css";
import Search from "./components/Search";
import Add from "./components/Add";
import data from "./";
import Singlevideo from "./SingleVideo";

function App() {
  return (
    <main>
      <header>
        <div className="title">
          <h2> VIDEO LIST</h2>
        </div>
        <div className="search">
          <Search />
        </div>
      </header>
      <section className="content">
        <div className="add">
          <Add />
        </div>
        <div>
          {data.map((video) => {
            return <Singlevideo key={video.id} {...video} />;
          })}
        </div>
      </section>
    </main>
  );
}

export default App;
